e:"チャネル名",close:"閉じる",respectTeam:"チームより敬意を込めて",thanks:"ご利用いただきありがとうございます！",disclaimer4:"さらに、私たちは定期的にデータベースとニュース選択アルゴリズムを更新して、提供される情報の質を向上させ、ユーザーに最適な体験を提供しています。",disclaimer3:"私たちは多様な視点を尊重し、できるだけ多くのトピックと情報源をカバーするよう努めており、ユーザーに世界の出来事についての包括的な見解を提供します。私たちの目標は情報リテラシーを向上させ、事実と客観的な情報に基づく対話を促進することです。",disclaimer2:"また、ユーザーは自らの意思で、私たちのボットで公開するニュースを選択します。このプロセスには介入せず、提供される情報の選択に影響を与えることはありません。私たちの役割は、ユーザーが幅広いニュースにアクセスし、提供されたデータに基づいて自分自身の結論を出すことができるプラットフォームを提供することだけです。",disclaimer1:"このTelegramボットは世界中のニュースを集約するものです。情報は「そのまま」提供され、その正確性、完全性、または最新性について責任を負いません。特に政治的な出来事に関して、ニュースに対する意見や評価は提供しません。私たちの目標は、多様で客観的な情報を提供することです。",disclaimer:"**免責事項: ニュース集約ツール**",cookiesText:"当サイトは、ユーザーエクスペリエンスを向上させるために「セッションクッキー」を使用する場合があります。",cookies:"セッションクッキー",googleAnalText:"私たちは、ユーザーが当サイトとどのようにやり取りしているかに関する非個人情報を収集および分析するためにGoogle Analyticsを使用しています。Google AnalyticsはGoogle Inc.（「Google」）が提供するウェブ解析サービスです。Google Analyticsはクッキーを使用しており、これらはユーザーのコンピュータに配置され、ユーザーがサイトをどのように使用しているかを分析するのに役立ちます。クッキーによって生成された情報（IPアドレスを含む）はアメリカにあるGoogleのサーバーに送信され、保存されます。この情報は、サイトの使用状況を評価し、サイト運営者のためにサイト活動に関する報告書を作成し、サイト活動およびインターネット使用に関連する他のサービスを提供するために使用されます。Googleは、法律で義務付けられている場合や第三者がGoogleの代理で情報を処理する場合、この情報を第三者に提供することがあります。このサイトを使用することで、上記の方法および目的でGoogleがユーザーに関するデータを処理することに同意することになります。",googleAnal:"Google Analyticsの使用",noPersonalDataText:"当サイトとやり取りするたびに、ユーザーに関する非個人識別情報を収集する場合があります。この情報には、ブラウザ名、コンピュータの種類、およびオペレーティングシステムやインターネットサービスプロバイダーなど、ユーザーの当サイトとの接続手段に関する技術情報が含まれる場合があります。",noPersonalData:"非個人識別情報",personalData:"私たちは、さまざまな方法でユーザーから個人識別情報を収集する場合があります。これには、サイト訪問、サイト登録、ニュースレターの購読、フォームの記入、および当サイトで提供される他の活動、サービス、機能、またはリソースに関連するその他の方法が含まれます。適切な場合、ユーザーに名前、メールアドレス、郵送先住所、電話番号を尋ねることがあります。ただし、ユーザーは匿名で当サイトを訪れることができます。私たちは、ユーザーが自主的に個人識別情報を提供する場合にのみ、その情報を収集します。ユーザーは、特定のサイト関連の活動に参加するのを妨げられる場合を除き、個人識別情報の提供を常に拒否することができます。",idInformation:"個人識別情報",information:"情報の収集",privacyPolicy:"このプライバシーポリシーは、4V.newsがユーザー（「ユーザー」）から情報を収集し、それを使用し、保存し、開示する方法を説明します。このポリシーは、ウェブサイト4V.news（「サイト」）で収集された情報に適用されます。",ps:"* 必須ではありませんが、利便性のために推奨されます",createText:"作成して送信",